import React from 'react';

const BecomeInstructor = () => (
    <section className="p-8 bg-blue-100 text-center">
        <h3 className="text-2xl font-bold mb-4">Become an Instructor</h3>
        <button className="px-6 py-3 bg-blue-600 text-white rounded hover:bg-blue-500">Start Teaching</button>
    </section>
);

